}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 32 32" xml:space="preserve"><circle id="layer1" cx="16" cy="16" r="16" class="aw-theme-iconOutline" fill="#ffffff"/><polygon id="layer2" points="16.6,29.9 14.2,19.6 4.3,23.4 21.6,5.4 " class="aw-theme-iconOutline" fill="#005F87"/></svg>';
